import { useState } from 'react';
import Cal from './Cal';
function App() {
  const [name, setName] = useState('');
  const [math, setMath] = useState();
  const [kor, setKor] = useState();
  const [eng, setEng] = useState();

  return (
    <div className="App">
      이름 :{' '}
      <input
        type="text"
        onChange={(e) => {
          setName(e.target.value);
        }}
      ></input>
      수학 :{' '}
      <input
        type="number"
        onChange={(e) => {
          setMath(e.target.value);
        }}
      ></input>
      영어 :{' '}
      <input
        type="number"
        onChange={(e) => {
          setEng(e.target.value);
        }}
      ></input>
      국어 :{' '}
      <input
        type="number"
        onChange={(e) => {
          setKor(e.target.value);
        }}
      ></input>
      <Cal name={name} math={math} kor={kor} eng={eng} />
    </div>
  );
}

export default App;
